{
  constructor()
  {
    super()
  }

  render()
  {


    return(
      <div className = "App-Border-User">
        Id: <br/>
        Name: <input type = "text" /><br/>
        Email: <input type = "text" /><br/>
        <input type = "button" value= "Other Data" />
        <input type = "button" value= "Update" />
        <input type = "button" value= "Delete" />

      </div>

    )
  }
}

export default Users;
